import './appointment-details.styles.scss';

function AppointmentDetails() {
	return(
        <div className='review'>
            <div className='back-btn-container'>
                <span className='back-btn'> &#767; </span>
            </div>
            <p className='review-header'>Enter Details</p>
            <p className="review-time">name</p>
            <p className="clock">Please share anything that will help prepare for our meeting.</p>
        </div>
	);
}

export default AppointmentDetails;
